// SPDX-License-Identifier: MIT
pragma solidity =0.8.8;


    contract controleFluxo{
        address []depositos;

        
        function salvar(address _endereco)external view returns(bool){
            for(uint i; i <depositos.length; i++){
                if(depositos[i] == _endereco){
                  return true;
                }
           }
           return false;
        }
    }

